import React from "react";
const Button = (props) => {
  if (this.props.id < 10)
    return (
      <button
        type="button"
        className="btn btn-primary"
        onClick={this.handleNext}
      >
        Next
      </button>
    );
  else
    return (
      <button type="button" className="btn btn-primary">
        Submit
      </button>
    );
};

export default Button;
